import React from "react";
import Card from "./Card";
import Button from "./Button";

const ErrorModal = () => {
	return (
		<Card>
			<header>
				<h2></h2>
			</header>
			<div>
				<p></p>
			</div>
			<footer>
				<Button>Okey</Button>
			</footer>
		</Card>
	);
};

export default ErrorModal;
